import React from 'react';
import {createRoot} from "react-dom/client";
import {APIProvider, Map, MapCameraChangedEvent} from '@vis.gl/react-google-maps';

const MainMap = () => {
    function userLocationSuccess (userPosition) {
        console.log("your current position " + JSON.stringify(userPosition))
    }
    
    function userLocationError (error){
        console.log("Error")
    }
    
    navigator.geolocation.getCurrentPosition(userLocationSuccess, userLocationError);
    
    return (
        <div className="flex justify-center items-center h-96 bg-gray-200">
            <APIProvider apiKey={'AIzaSyA4u5WHz6-4ldEWPwyrjjjhhtkOwVm1lyo'} onLoad={() => console.log('Maps API has loaded.')}>
   <Map defaultZoom={13} defaultCenter={ { lat: position.coords.latitude, lng: position.coords.longitude } }> </Map>
            </APIProvider>
        </div>
    );


};

export default MainMap;
